import React from "react";

class Data extends React.Component{
    render(){
        return (
<table className="table col-6 mx-auto mt-5">

  <tbody>
    <tr>
      <th scope="row">City</th>
      <td>Mark</td>
    </tr>
    <tr>
      <th scope="row">Country</th>
      <td>Jacob</td>
    </tr>
    <tr>
      <th scope="row">Temperature</th>
      <td>Larry</td>
    </tr>
  </tbody>
</table>
        );
    }
}

export default Data;
